import sys
from collections import deque
import time # time 라이브러리 import
start = time.time() # 시작
 
 


def fail(p):
    m, j = len(p), 0
    l = [0]*m
    for i in range(1, m):
        while j > 0 and p[i]!=p[j]:
            j = l[j-1]
        if p[i] == p[j]:
            j+=1
            l[i] = j
    return l
test1 = ''
test2 = 'abcdefghijklmnopqrstuvwxyabcdefghijklmnopqrstuvwxyabcdefghijklmnopqrstuvwxyabcdefghijklmnopqrstuvwxyabcd'

# test1 = 'winlose???winl???w??'
# test2 = 'win'
# test1 = '???cab?????'
# test2 = 'abcab'
# test1 = 'glo?yto?e??an?'
# test2 = 'or'
lst1 = list(map(str,test1.rstrip()))
lst2 = list(map(str,test2.rstrip()))
l1_len = len(lst1)
l2_len = len(lst2)
LCS = [[0 for _ in range(l1_len)] for _ in range(l2_len)]

# print(lst1)
# print(lst2)

LCS = [[i + 1 if lst1[j] == lst2[i] or lst1[j] == '?' else 0 for j in range(l1_len)] for i in range(l2_len)]

print('LCS over')

cal = fail(lst2)
# print(cal)
# for i in LCS:
#     print(i)
ans = 0
i = 0
y = 0
dp = [0]*l1_len

while i < l1_len:
    x = i
    if LCS[y][x] != 0:
        while y < l2_len and x < l1_len:
            if LCS[y][x] == l2_len:
                # print(x,y)
                dp[x] += 1
                i += 1
                y = 0
                
                break
            if LCS[y][x] != 0:
                x+=1
                y+=1
            else:
                i += 1
                y = 0
                break
    else:
        i+=1
        y = 0
    if x >= l1_len:
        break
# print(dp)
# print('dp over')

que = deque()
visited = []
que.append([0,0])
ans = 0
while que:
    # print(que)
    location , score = que.popleft()
    
    while location < l1_len:
        if dp[location] == 0:
            location += 1
        else:
            score += 1
            if location + cal[-1] + 1 < l1_len and location+cal[-1]+1 not in visited:
                que.append([location + cal[-1]+1 , score])
                visited.append(location+cal[-1]+1)
            if location + l2_len < l1_len and location+l2_len not in visited:
                que.append([location + l2_len , score])
                visited.append(location+l2_len)
            break
    if location >= l1_len-1:
        ans = max(ans , score)

print(ans)


print(f"{time.time()-start:.4f} sec") # 종료와 함께 수행시간 출력